import '../../data/models/period_pricing_dto.dart';class PeriodPricing {  PeriodPricing({    this.id,    this.name,    this.timeName,    this.price,    this.fromDay,    this.toDay,  });  PeriodPricing.fromJson(dynamic json) {    id = json['id'];    name = json['name'];    timeName = json['timeName'];    price = json['price'];    fromDay = json['fromDay'];    toDay = json['toDay'];  }  int? id;  String? name;  String? timeName;  String? price;  String? fromDay;  String? toDay;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name'] = name;    map['timeName'] = timeName;    map['price'] = price;    map['fromDay'] = fromDay;    map['toDay'] = toDay;    return map;  }  factory PeriodPricing.fromDto(PeriodPricingDto json) {    return PeriodPricing(      id: json.id,      name: json.name,      fromDay: json.fromDay,      price: json.price,      timeName: json.timeName,      toDay: json.toDay,    );  }}